import React from "react";

import Text from "../elements/Text";
import styled from "styled-components";

const Post = (props) => {
  return (
    <React.Fragment>
      <DIV>
        <Image></Image>
        <h2 style={{ fontSize: "16px" }}>{props.title}</h2>
        <p>{props.price}</p>
        <p>{props.region}</p>
        <p>
          {props.like} {props.chat}
        </p>
      </DIV>
    </React.Fragment>
  );
};

Post.defaultProps = {
  title: "실내 자전거",
  img:
    "https://dnvefa72aowie.cloudfront.net/origin/article/202104/bce02f7c25d41ea2f758c3322de4596b9768b7fc8822ed6ab1a184fd232c50ce.webp?q=82&s=300x300&t=crop",
  price: "10,000원",
  region: "경기도 용인시 수지구 죽전동",
  like: "관심:3",
  chat: "채팅:5",
};

export default Post;

const DIV = styled.div`
  width: calc(25% - 44px);
  margin-right: 44px;
  margin-bottom: 56px;
`;

const Image = styled.img`
  width: 201px;
  height: 201px;
  background-image: url("https://dnvefa72aowie.cloudfront.net/origin/article/202104/bce02f7c25d41ea2f758c3322de4596b9768b7fc8822ed6ab1a184fd232c50ce.webp?q=82&s=300x300&t=crop");
  background-size: 201px 201px;
  border-radius: 12px;
  border: 1px solid transparent;
`;
